import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

//Paginas


function App() {
  return (
    <div className="App">
        <Router>
      <Routes>
        <Route path="/" element={<Appc />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </Router>
    </div>
  );
}

export default App;
